import React from "react";
import "./home.css";

function Home() {
  return (
    <div className="container-home">
      <div className="sidebar">
        <div>
          <a href="/product">Donanım Arşivi</a>
        </div>
      </div>
      <div className="content">
        <h1>Son eklenen ürünler</h1>
      </div>
    </div>
  );
}

export default Home;
